  return (
    <>
      <Navbar />
      <div className="hpmain">
        <div className="hpleft">
          <div className="topIcons">
            <HpIcons icon={explore} />
            <HpIcons icon={explore} />
            <HpIcons icon={explore} />
            <HpIcons icon={explore} />
          </div>
          <div className="bottomIcon"></div>
        </div>
        <div className="hpright">
          <div className="filterhandles"></div>
          <div className="searchResults"></div>
        </div>
      </div>
    </>
  );
}

export default HomePage;
